pragma solidity ^0.4.23;
import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import 'openzeppelin-solidity/contracts/math/SafeMath.sol';

contract SimpleReservationSingleWithdrawer is Ownable {
	using SafeMath for uint256;

	address public withdrawerAddress;
	address public withdrawDestinationWalletAddress;

	//Here we are storing a mapping betwеen the reservation checkout dates and sum of all reservation costs for this day.
	mapping (uint => uint256) public reservationsWithdrawMap;
	ERC20 public LOCTokenContract;

	event LogCreateReservation(address indexed _customerAddress, uint _reservationCheckOutDate, uint _reservationCostLOC);
	event LogWithdrawal(address indexed withdrawer, uint256 withdrawedAmount);

	constructor(address _locTokenContractAddress, address _withdrawerAddress, address _withdrawDestinationWalletAddress) public {
		LOCTokenContract = ERC20(_locTokenContractAddress);
		withdrawerAddress = _withdrawerAddress;
		withdrawDestinationWalletAddress = _withdrawDestinationWalletAddress;
	}

	modifier onlyWithdrawer(){
		require(withdrawerAddress == msg.sender);
		_;
	}

	function setLOCTokenContractAddress(address locTokenContractAddress) public onlyOwner {
		LOCTokenContract = ERC20(locTokenContractAddress);
	}

	function setWithdrawerAddress(address _withdrawerAddress) public onlyOwner {
		withdrawerAddress = _withdrawerAddress;
	}

	function setWithdrawDestinationWalletAddress(address _withdrawDestinationWalletAddress) public onlyOwner {
		withdrawDestinationWalletAddress = _withdrawDestinationWalletAddress;
	}

	function formatTimestampToDaysOnly(uint _dateToConvert) public view returns (uint _convertedDate) {
		return _dateToConvert / (1 days );
	}

	function createReservation(
		uint256 _reservationCostLOC,
		uint _reservationCheckOutDate
	) public returns(bool success) {
		require(_reservationCostLOC > 0);
		uint nowInDays = formatTimestampToDaysOnly(now);
		require(nowInDays < _reservationCheckOutDate);

		reservationsWithdrawMap[_reservationCheckOutDate] = reservationsWithdrawMap[_reservationCheckOutDate].add(_reservationCostLOC);

		assert(LOCTokenContract.transferFrom(msg.sender, this, _reservationCostLOC));
		emit LogCreateReservation(msg.sender, _reservationCheckOutDate, _reservationCostLOC);
		return true;
	}

	function withdrawReservation(uint _dateForWithdraw) onlyWithdrawer() public returns(bool success) {
		uint nowInDays = formatTimestampToDaysOnly(now);
		require(_dateForWithdraw > 0);
		require(nowInDays > _dateForWithdraw);

		uint256 amountToWithdraw = reservationsWithdrawMap[_dateForWithdraw];
		reservationsWithdrawMap[_dateForWithdraw] = 0;

		assert(LOCTokenContract.transfer(withdrawDestinationWalletAddress, amountToWithdraw));
		emit LogWithdrawal(withdrawDestinationWalletAddress, amountToWithdraw);
		return true;
	}

	function withdrawReservationWithLargerTimestamp(uint _dateForWithdraw) onlyWithdrawer() public returns (bool success) {
		require(_dateForWithdraw > 0);
		require(now > _dateForWithdraw);

		uint256 amountToWithdraw = reservationsWithdrawMap[_dateForWithdraw];
		reservationsWithdrawMap[_dateForWithdraw] = 0;

		assert(LOCTokenContract.transfer(withdrawDestinationWalletAddress, amountToWithdraw));
		emit LogWithdrawal(withdrawDestinationWalletAddress, amountToWithdraw);
		return true;
	}
}
